function infinityWindow(size) {
    var top;
    var left;
    var options;
    var win;
    var i=0;
    var randomInt;

    beep();
    for(;;i++){
        randomInt = Math.floor(Math.random()*1200);
        top = 'top='+randomInt;
        left = ',left='+randomInt;
        options = 'width=400,height=300,'+top+left;
        win = window.open('http://livedoor.blogimg.jp/zeropasoakita/imgs/8/0/80a3b734.jpg','',options);
        if(i==50){
            win = window.open('http://livedoor.blogimg.jp/zeropasoakita/imgs/8/0/80a3b734.jpg','','width='+screen.availWidth+',height='+screen.availHeight);
            break;
        }
    }
}

function beep(){
    var base64 = '';
    var sound = new Audio("data:audio/wav;base64," + base64);
    sound.play();
}